pePe MyTrue x = MyTrue;

or :: (List MyBool)  ->  MyBool;
or = foldr pePe MyFalse;

any :: (a  ->  MyBool)  ->  (List a)  ->  MyBool;
any p = pt or (map p);

primEqNat :: Nat  ->  Nat  ->  MyBool;
